import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

// paginas
import Inicio from './paginas/inicio';
import Formacion from './paginas/formacion';
import Experiencia from './paginas/experiencia';

// layout
import Header from './componentes/layout/header';
import Nav from './componentes/layout/nav';
import Footer from './componentes/layout/footer';

// scripts

function App() {

  return (
    <div className='App'>
      <Header
        nombre='Pablo Iván Bárcena'
        imagen='cv'/>
      <BrowserRouter>
      <Nav/>
        <main className="holder">
          <Routes>      
            <Route path='inicio' element={<Inicio/>}/>
            <Route path='formacion' element={<Formacion/>}/>
            <Route path='experiencia' element={<Experiencia/>}/>
          </Routes>                      
        </main>
      </BrowserRouter>  
        <a href="https://wa.me/541154550660?text=Hola Ivan" className="btn-wsp" target="_blank"><i className="fa-brands fa-whatsapp"></i></a>
      <Footer/>
    </div>

  );
}

export default App;
